  \"Lightweight Non-Compacting Aerogel Insulation for Cryotanks Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T05:55:09.384615\",\n\t\"name\": \"lightweight-non-compacting-aerogel-insulation-for-cryotanks-project-eb17f\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The exploration of space requires that new
  technologies be developed for long-term cryogenic propellant storage applications
  in-space, on the lunar surface, and on the Earth.  The Altair ascent stage requires
  LO2 and LCH4 storage durations of up to 14 days in LEO and up to an additional 210
  days on the lunar surface.  Long term storage (224 days) of LO2 cryogenic propellant
  on the lunar surface is required to support space power systems, spaceports, spacesuits,
  lunar habitation systems, robotics, and in situ propellant systems.  Long term storage
  (6 months) of LO2/ LH2/ LCH4 cryogenic propellants in 1-g on the surface of the
  Earth with minimal propellant loss is required to support launch site ground operations.
  \ Thus, this proposed project will focus on improving the strength of aerogels,
  which are the lightest weight and best cryogenic insulation material known.  Improvements
  in the strength of aerogels would allow these materials to be used as advanced non-compacting
  insulation materials capable of retaining structural integrity while accommodating
  large operating temperatures ranging from cryogenic to elevated temperatures.  The
  properties of the aerogels will be tailored by controlling their densities and strengthened
  by reinforcing them with fibers and with organic polymer crosslinking agents.\",\n\t\"license_title\":
